 @andarilho_31  Conquistar a Libertadores é difícil, porém, não é impossível. Com a estrutura que o Athletico Paranaense tem, planejamento vindouro e  a raça desse clube, provável que um dia seja campeão do mesmo.
Corinthians e Atlético Mineiro ambos conquistaram a Copa Libertadores depois do centenário, já o CAP nem é um clube centenário, já chegou em uma final, na qual não pode jogar no próprio estádio por falta de capacidade segundo a Conmebol. 
A próxima vez que o Athletico chegar em outra final, jogará junto com a torcida; será um clube com camisa mais pesada desde a última vez, também terá um elenco mais qualificado. Cada conquista perdida é um aprendizado e cada conquista ganho é a reflexão de um bom trabalho, que precisa dar continuidade para que o mesmo prossiga.
De 2000 para cá muita coisa mudou: 
*Corinthians se tornou uma potencia no futebol brasileiro (Série A 2005,2011,2015,2017), Libertadores e dois mundiais;
*Atlético Mineiro conquistou Libertadores, Recopa Sulamericana e Copa do Brasil;
*São Paulo conquistou Liberadores-Mundial (2005) e três brasileirão (2006,2007,2008);
*Internacional conquistou duas Libertadores e um Mundial;
Cruzeiro conquistou três brasileiros (2003,2013,2014) e três Copa do Brasil (2003,2017,2018).
Enfim, muitos outros clubes cresceram muito de 2000 para cá, com conquistas inéditas e mudança de patamar. 
O Athletico também cresceu muito do ano 2000 até 2021: 1 Brasileiro, 1 Copa do Brasil , 1 Sulamericana, 1 Levain Cup, além de quatro vice: Brasileirão 2004, Libertadores 2005, Copa do Brasil 2013 e Recopa Sulamericana 2019.
A conquista da Copa Libertadores não será fácil, mas um dia o Athletico Paranaense será Campeão depois do centenário. Hoje em dia não existe mais bobo no futebol, o nível técnico das equipes elevaram muito, de tal modo que, aumentou muito a qualidade e a competitividade do futebol.

Que Deus abençoe cada um de vocês, paz!

